INSERT INTO `block_content_revision__body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `langcode`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('basic', 0, 1, 1, 'en', 0, '<div class="logo-centered"><a class="site-branding__logo" href="#" rel="home" title="Home"><img alt="Home" src="http://mttprojects.s3.amazonaws.com/demo.morethanthemes.com/showcaseplus/placeholders/logo-bright.svg" /> </a></div>\r\n\r\n<div class="text-center bottom-spacing-medium clearfix">\r\n<div class="site-name site-branding__name"><a href="#" rel="home" title="Home">SHOWCASE LITE</a></div>\r\n\r\n<div class="site-slogan site-branding__slogan">FREE DRUPAL 8 THEME</div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 2, 2, 'en', 0, '<ul class="social-links social-links--inline text-center">\r\n	<li><a class="hover-color-facebook" href="http://www.facebook.com/morethan.just.themes/">Facebook</a></li>\r\n	<li><a class="hover-color-twitter" href="http://twitter.com/morethanthemes/">Twitter</a></li>\r\n	<li><a class="hover-color-behance" href="https://www.behance.net/morethanthemes">Behance</a></li>\r\n	<li><a class="hover-color-youtube" href="https://www.youtube.com/user/morethanthemes/videos">Youtube</a></li>\r\n	<li><a class="hover-color-instagram" href="#">Instagram</a></li>\r\n	<li><a class="hover-color-vimeo" href="#">Vimeo</a></li>\r\n</ul>\r\n', '', 'full_html'),
('basic', 0, 3, 3, 'en', 0, '<ul class="icons-list icons-list--large">\r\n	<li><a href="http://www.facebook.com/morethan.just.themes/"><i class="fa fa-facebook-square"><span class="sr-only">facebook</span></i></a></li>\r\n	<li><a href="http://twitter.com/morethanthemes/"><i class="fa fa-twitter-square"><span class="sr-only">twitter</span></i></a></li>\r\n	<li><a href="http://instagram.com/"><i class="fa fa-instagram"><span class="sr-only">instagram</span></i></a></li>\r\n	<li><a href="http://www.pinterest.com/morethanthemes/"><i class="fa fa-pinterest-square"><span class="sr-only">pinterest</span></i></a></li>\r\n	<li><a href="http://www.youtube.com/morethanthemes/"><i class="fa fa-youtube-square"><span class="sr-only">youtube</span></i></a></li>\r\n	<li><a href="http://www.linkedin.com/company/more-than-themes/"><i class="fa fa-linkedin-square"><span class="sr-only">linkedin</span></i></a></li>\r\n	<li><a href="http://www.flickr.com/photos/morethanthemes/"><i class="fa fa-flickr"><span class="sr-only">flickr</span></i></a></li>\r\n</ul>\r\n', '', 'full_html'),
('basic', 0, 4, 4, 'en', 0, '<div class="overlay-container"><img alt="sidebar image" src="http://mttprojects.s3.amazonaws.com/demo.morethanthemes.com/showcase-lite/block-img.jpg" /></div>\r\n\r\n<h3><a href="#">Sidebar block with image</a></h3>\r\n\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do <a href="#">eiusmod tempor</a> incididunt ut labore et dolore magna aliqua.</p>\r\n\r\n<p class="more-link"><a href="#">read more</a></p>\r\n', '', 'full_html'),
('basic', 0, 5, 5, 'en', 0, '<div class="background-image-block__section field--mt-background-image-block">\r\n<div class="background-image background-image--attachment-scroll" style="background-image: url(http://mttprojects.s3.amazonaws.com/demo.morethanthemes.com/showcase-lite/background-image-banner.jpg);">&nbsp;</div>\r\n\r\n<div class="background-image-overlay region--dark-typography region--white-background" style="opacity: 0.6;">&nbsp;</div>\r\n\r\n<div class="container-fluid region--dark-typography region--white-background block">\r\n<div class="row bottom-spacing-medium">\r\n<div class="col-md-8 col-md-offset-2 text-center">\r\n<h3 class="block-title block-title--extra-large">SHOWCASE LITE</h3>\r\n\r\n<div class="bottom-spacing-medium">\r\n<p class="large">A Bootstrap-based Free Drupal 8 Theme by <a href="http://www.morethanthemes.com" target="_blank">More than Themes</a></p>\r\n</div>\r\n\r\n<div class="bottom-spacing-large">\r\n<p class="text-center"><a class="button" href="#">Services</a><a class="button" href="#">Contact</a></p>\r\n</div>\r\n\r\n<div class="scroll-button smooth-scroll"><a href="#page-start"><span class="sr-only">Content start</span></a></div></div>\r\n</div>\r\n</div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 6, 6, 'en', 0, '<div class="background-image-block__section field--mt-background-image-block">\r\n<div class="background-image background-image--attachment-scroll" style="background-image: url(http://mttprojects.s3.amazonaws.com/demo.morethanthemes.com/showcase-lite/background-image-banner.jpg);">&nbsp;</div>\r\n\r\n<div class="background-image-overlay region--light-typography region--black-background" style="opacity: 0.7;">&nbsp;</div>\r\n\r\n<div class="container region--light-typography region--black-background block">\r\n<h2 class="block-title--extra-large text-center">CONTACT US</h2>\r\n\r\n<p class="text-center large">Lorem ipsum dolor sit amet.</p>\r\n</div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 7, 7, 'en', 0, '<div class="contact-info">\r\n<span class="icon"><i class="fa fa-globe"></i></span>\r\n<h3>Contact info</h3>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>\r\n<ul>\r\n<li><i class="fa fa-map-marker"><span class="sr-only">address</span></i> 1600 Amphitheatre Parkway, <br> Mountain View, CA 94043</li>\r\n<li><i class="fa fa-phone"><span class="sr-only">phone</span></i> +321 123 456 7 <br> +012 123 123 12</li><li><i class="fa fa-print"><span class="sr-only">fax</span></i> +321 123 456 8 <br> +21 123 456 87 </li>\r\n<li><i class="fa fa-envelope-o"><span class="sr-only">email</span></i>For general enquiries: <br> <a href="mailto:info@showcaseplus.com">info@showcaseplus.com</a> <br> For sales enquiries: <br> <a href="mailto:sales@showcaseplus.com">sales@showcaseplus.com</a></li>\r\n</ul>\r\n</div>', '', 'full_html');
